(function() {
    'use strict';
    var vipurls = {
        1:["虾米解析（推荐）", "https://jx.xmflv.com/?url="],
        2:["JSONPlayer播放器", "https://jx.jsonplayer.com/player/?url="],
        3:["M1907 云加速播放器", "https://im1907.top/?jx="],
        4:["咸鱼云", "https://jx.aidouer.net/?url="],
        5:["夜幕解析", "https://www.yemu.xyz/?url="],
        6:["YangTu", "https://jx.yangtu.top/?url="],
        7:["七哥解析接口", "https://jx.nnxv.cn/tv.php?url="],
    }
    var urltext = ""
    for(let i in vipurls){
        urltext += i + " - " + vipurls[i][0] + " -- " + vipurls[i][1] + "\n"
    }
    var urlnum = GM_getValue('urlnum');
    console.log("解析地址编号：" + urlnum);
    if(urlnum == null || !(urlnum in vipurls)){
        urlnum = 1
        GM_setValue('urlnum', urlnum);
    }
    // 添加样式
    const style = `<style>
    .btnn{
        position:fixed;
        right:20px;
        bottom:30px;
        background-color:white!important;
        width: 40px;
        color:black!important;
        height: 30px;
        border-radius: 5px;
        border:solid 3px red!important;
        outline: none;
        cursor:pointer;
        text-align: center!important;
        padding-inline: 0px!important;
        font-size: 14px!important;
        z-index: 99999999999999!important;
    }
    .btnn:hover{
        background-color:black!important;
        color:white!important;
    }
    </style>`;
    let div = document.createElement("div");
    div.innerHTML += style;
    document.body.append(div);
    // main
    var btn = document.createElement("input");
    btn.setAttribute("type", "button");
    btn.setAttribute("title", "右键更换解析接口");
    btn.setAttribute("value", "解析");
    btn.classList.add('btnn');
    document.body.append(btn);
    btn.onclick = function(){
        window.open(vipurls[urlnum][1] + window.location.href, '_self');
    }
    btn.addEventListener("contextmenu", function() {
        var newnum = prompt("当前接口为：" + urlnum + " - " + vipurls[urlnum][0] + "，请输入更换接口的编号：\n" + urltext);
        if(newnum in vipurls){
            urlnum = newnum
            GM_setValue('urlnum', urlnum);
        } else if(newnum != null){
            alert("编号不在有效范围内，请重新输入！！！");
        }
        console.log("解析地址编号：" + urlnum);
    });
})();